46.body:
table,th, td { /* 为表格增加边框 */ border: 2px solid; /* 将表格的默认双横线边框设置为单实线 */ border-collapse: collapse; /* 将表格隐藏 */ visibility: hidden; /* 移除表格 */ display: none;
}
/* 当鼠标悬停在某行上, 显示高亮 */
tr:hover { background-color: blue;
}

49.body:
/* 子代选择器 */
/* 只有Hey会变为红色, 因为这么写只会寻找其子标签而不会寻找其孙标签*/
h1 > b { color: red;
}
/* 相邻兄弟选择器 */
/* 只有What?会变为红色, 因为选择的是与h1相邻的b标签, 所以What?会变红*/
h1 + b { color: red;
}
/* 通用兄弟选择器 */
/* What?和What2?都会变为红色, 因为选中的是与h1同级的后续b标签
h1 ~ b { color: red;
}

52.body:
.dropdownbutton { background-color: blue; color: white; padding: 13px; font-size: 16px; border: none; /* 将鼠标设置为一只小手 */ cursor: pointer;
} .dropdown { position: relative; display: inline-block;
} .dropdown-menu { display: none; position: absolute; background-color: light-blue; min-width: 150px;
} .dropdown-menu a { color: black; padding: 11px 15px; text-decoration: none; display: block;
} .dropdown-menu a:hover { background-color: white;
} .dropdown:hover .dropdown-menu { display: block;
} .dropdown:hover .dropdownbutton { background-color: grey;
}

